import React from 'react';
import Line from './small-components/Line';
import styled from '@emotion/styled';
import { alignProperty } from '@mui/material/styles/cssUtils';

const LinesWrapper = styled('div')(({ theme }) => ({
    display: 'flex',
    flexDirection: 'column',
    flexGrow: '1',
    gap: '10px',
    width: '100vw',
    heigth: '100vh',
    margin: '10px',
    minHeight:'70%'
  }));

const HomeContent = ({list}) => {
  const handleInfoClick = () => {
    alert('Info button clicked');
  }
  return (
    <>
    <LinesWrapper>
      {list.map(x => {
        return (
          <>
          <img src={'.../data/images/' + x.img} alt=''/>
          <Line avatarSrc={'../data/images/' + x.img} avatarAlt={x.userName} avatarSize={40} infoOnClick={handleInfoClick} />
          </>
        )
      })}
    </LinesWrapper>
    </>
  );
}

export default HomeContent;
